INSERT INTO `site` VALUES (1,12067,'Toulouse centre-ville',_binary '','2021-11-05 06:23:59','Ce site regroupe tous les secteurs qui se trouvent dans Toulouse intra muros. Une licence CAF ou une convention est nÃ©cessaire pour Ãªtre couvert en cas de problÃ¨me.','Il est possible d\'accÃ©der facilement Ã  tout le centre ville Ã  l\'aide des transports en commun (Bus, MÃ©tro, Tram).',NULL,NULL),(2,12635,'Bordeaux intra-muros',_binary '\0','2021-11-05 07:22:58',NULL,NULL,NULL,NULL),(3,12748,'Falaise de la Lirette',_binary '','2021-11-05 07:58:38','Au milieu dâ€™un site unique en Gironde, plus de 100 voies dâ€™escalade vous attendent avec des difficultÃ©s allant du 4c au 7b.\r\nCette falaise de 8 m Ã  20 m de haut, de type calcaire Ã  astÃ©ries, vielle de 25 millions dâ€™annÃ©es, est une ancienne carriÃ¨re de pierre exploitÃ©e des annÃ©es 1900 Ã  1930, qui a Ã©tÃ© rÃ©habilitÃ©e par la mairie de Frontenac en 1994, pour crÃ©er un vÃ©ritable site d\'escalade.','Depuis Frontenac centre prendre la route de Chollet sur 200m puis tourner Ã  gauche sur le chemin de la Lirette. Sur votre gauche vous trouverez un parking depuis lequel un panneau indique le chemin Ã  pied vers la falaise.',NULL,NULL),(4,62,'La Falaise d\'Armix',_binary '\0','2021-11-05 09:58:47','Les falaises d\'Armix de la Burbanche et leurs abords abritent un Ã©cosystÃ¨me riche. Il nâ€™est pas rare dâ€™apercevoir des chamois au sommet et au pied des falaises ou le faucon pÃ¨lerin en vol. Faites vous discret, ne criez pas plus que nÃ©cessaire dans les voies et emportez vos dÃ©chets. PrÃ©servez Ã©galement la flore sur la falaise : lierres, lichens, fleurs et joubarbes.','Lâ€™accÃ¨s au sommet des voies depuis le parking est de 10 minutes puis en rappel dans les voies (conseillÃ©). Un chemin permet nÃ©anmoins lâ€™accÃ¨s au pied des voies et le retour en cas de but (25 minutes). A noter que lâ€™escalade est interdite sur les falaises de la Burbanche en pÃ©riode de chasse, soit Ã  partir de mi-aoÃ»t jusque fÃ©vrier.',NULL,NULL),(5,35720,'Ravine Claude',_binary '\0','2021-11-05 10:22:37','Un petit site avec quelques beaux passages. IdÃ©al pour ceux qui habitent dans le coin ! Il nâ€™y a pas de marche dâ€™approche et vous pouvez y aller en famille.','Il faut gagner la D13 qui parcours les hauts de St Leu. La ravine se trouve juste au nord du quartier â€œLâ€™Ã©tang St Leuâ€, cf la carte. Aire de stationnement au niveau du panneau indiquant â€œEtang St Leuâ€.',NULL,NULL),(6,26566,'Opoul',_binary '\0','2021-11-09 09:23:54','Tous les secteurs autour de la magnifique ville d\'Opoul-PÃ©rillos prÃ¨s de Perpignan. Avec des voies de grande difficultÃ© mais une vue imprenable sur la vallÃ©e en contre-bas.','Depuis Perpignan prendre vers le nord la A9 direction Narbonne. Sortie 41 Perpignan-Nord puis direction Opoul-PÃ©rillos.',NULL,NULL);
