INSERT INTO `topo` VALUES (1,2,15,_binary '\0',NULL,'Toulouse et ses environs','Ce topo contient les sites d\'escalade de la ville de Toulouse et ses environs. Entre autres, le secteur \"Les berges de la Garonne\".','Toulouse','2021-11-09 10:25:30'),(2,2,15,_binary '',NULL,'Toulouse intra-muros','Ce topo prÃ©sente tous les site d\'escalades mais uniquement du centre ville de Toulouse.','Toulouse centre-ville','2021-11-09 10:27:44'),(3,2,15,_binary '',NULL,'Opoul-PÃ©rillos','Ce topo rassemble les informations pour les secteurs de la \"Falaise des Abeilles\" & de la \"Falaise Gratounette\".','Roc-Rodon','2021-11-09 10:31:27'),(4,2,14,_binary '',NULL,'Bordeaux','Dans ce topo on retrouve toutes les informations sur les sites d\'escalades prÃ¨s de Bordeaux.','Bordeaux','2021-11-09 10:34:21'),(5,2,14,_binary '',NULL,'Falaise de la Lirette','Rassemble toutes les informations sur le site de la \"Falaise de la Lirette\".','Frontenac','2021-11-09 10:35:34'),(6,2,16,_binary '\0',3,'La Falaise d\'Armix','Ce topo prÃ©sente \"Les falaises d\'Armix\" de la Burbanche et leurs abords qui abritent un Ã©cosystÃ¨me riche. Il nâ€™est pas rare dâ€™apercevoir des chamois au sommet et au pied des falaises ou le faucon pÃ¨lerin en vol. Faites vous discret, ne criez pas plus que nÃ©cessaire dans les voies et emportez vos dÃ©chets. PrÃ©servez Ã©galement la flore sur la falaise : lierres, lichens, fleurs et joubarbes.','La Burbanche','2021-11-09 10:38:36'),(7,4,4,_binary '\0',2,'Ravine Claude','Ce topo prÃ©sente le site de la \"Ravine Claude\". Avec un petit secteur et quelques beaux passages. IdÃ©al pour ceux qui habitent dans le coin ! Il nâ€™y a pas de marche dâ€™approche et vous pouvez y aller en famille. Des secteurs Ã  lâ€™ombre pour grimper tout au long de la journÃ©e.','Saint-Leu','2021-11-09 10:54:51'),(8,5,15,_binary '',NULL,'Les berges de la Garonne','Ce topo se concentre sur le secteur des \"Berges de la Garonne\" dans le centre-ville de Toulouse.','Toulouse','2021-11-09 10:56:59');
